// @description		Replaces the slideshow on Medienzentrums Kassel's website and therefore on the school-browsers' homepage with a GIF containing the text "Abistreich 2016" and a moving background.
// @description:de	Ersetzt die Slideshow der Website des Medienzentrums Kassel und damit der Startseite der Schul-Browser durch einem GIF mit dem Text "Abistreich 2016" und einem bewegten Hintergrund.
