// Current date
var today = new Date();
// Day of the graduation prank 2016
var start = Date.parse('June 15, 2016');
// Last day of school
var end = Date.parse('July 14, 2016');
// Slideshow element
var slideshow = document.getElementById('slideshow');

// Display duration: 15.06.16 - 14.07.16
if (today >= start && today <= end) {
	// Insertion of the Base64-GIF and the explanation link
	slideshow.innerHTML = '<a href="https://jonas-thelemann.de/abistreich" title="Anzeigedauer: 15.06.16 - 14.07.16"><img src="data:image/gif;base64," alt="ABISTREICH"></img></a>';
}